import "./Projects.css";

class Projects extends Component {
  render() {
    return (
      <div className="projectMain">
        {/* <div className="projectContainer"> */}
        <div className="sidebar">
          <h5 className="projectHeader">My Projects</h5>
          <ul>
            <li>
              <a className="sideName" id="anagram">
                Anagram Generator
              </a>
            </li>
            <li>
              <a className="sideName" id="proof">
                Proof Technology Webpage
              </a>
            </li>
          </ul>
        </div>
        <div className="mainItem">
          {/* <h6 className="subHeader">Anagram Generator</h6>
